import styled from 'styled-components'

const Header = (props) => {
    return ( 
      <Nav>
        <Logo>
          <img src="/images/logo.svg" alt="Disney+" />
        </Logo>
        <NavMenu>
          <a href="/home">
            <img src="/images/home-icon.svg" alt="HOME" />
            <span>HOME</span>  
          </a>
          </NavMenu> 
      </Nav>
    );    
};

const Nav = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  height: 120px;
  background-color: #090b13;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 36px;
  letter-spacing: 16px;
  z-index: 3;
`;

const Logo = styled.a`
  padding: 0;
  width: 140px;
  margin-top: 4px;
  max-height: 70px;
  font-size: 0;
  display: inline-block;

  img {
      display: block;
      width: 100%;
  }
`;

const NavMenu = styled.div`
  align-items: center;
  display: flex;
  felx-flow: row nowrap;
  height: 100%;
  justify-content: flex-end;
  margin: 0px;
  padding: 0px;
  position: relative;
  margin-right: auto;
  margin-left: 25px;

  a{
    display: flex;
    align-items: center;
    padding: 0 12px;


    img{
      height: 20px;
      min-width: 20px;
      width: 20px;
      z-index: auto;
    }

    span {
      height: 80px;
      min-width: 80px;
      width: 80px;
      color: rgb(249, 249, 249);
      font-size: 13px;
      letter-spacing: 1.42px;
      line-height: 1.08;
      padding: 2px 0px;
      white-space: nowrap;
      position: relative;
    }
  }

  /* @media (max-width: 768px) {
    display: none;
  } */
`;

export default Header;
